int main(){
//sundaymorning_map[].size()
//printf("Length of array: %d\n",(int)(sizeof(sundaymorning_map)));

    volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
    // declare other variables(not shown)
    // initialize location and direction of rectangles(not shown)
	
	
    /* set front pixel buffer to start of FPGA On-chip memory */
    *(pixel_ctrl_ptr + 1) = 0xC8000000; // first store the address in the 
                                        // back buffer
    /* now, swap the front/back buffers, to set the front buffer location */
    wait_for_sync();
    /* initialize a pointer to the pixel buffer, used by drawing functions */
	//pixel_ctrl_ptr is actaully a int**
    pixel_buffer_start = *pixel_ctrl_ptr;//this access the memory of pixel buffer start;
    clear_screen(); // pixel_buffer_start points to the pixel buffer
    /* set back pixel buffer to start of SDRAM memory */
	//back buffer
    *(pixel_ctrl_ptr + 1) = 0xC0000000;
    pixel_buffer_start = *(pixel_ctrl_ptr + 1); // we draw on the back buffer

    while (1)
    {
		clear_screen();

		plot_image(marioBG,240,320);	

        wait_for_sync(); // swap front and back buffers on VGA vertical sync
        pixel_buffer_start = *(pixel_ctrl_ptr + 1); // new back buffer
		//printf("pixel_buffer_start%d\n", pixel_buffer_start);
    }
}




void plot_image(int img[], int height, int width){
	int i = 0, j = 0;	
	
	for (int k = 0 ; k < (height * width * 2)-1; k+= 2) {
		
		int red = ((img[k + 1] & 0xF8) >> 3) << 11;
		int green  = (((img[k] & 0xE0) >> 5)) | ((img[k+1] & 0x7) << 3) ;		
		int blue = (img[k] & 0x1f);			

		short int p = red | ( (green << 5) | blue);

		plot_pixel(i, j, p);

		i+=1;		  
		if (i == width) {
			i = 0;
			j+=1;
		}
	}
}

void wait_for_sync(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	int status;
	//write 1, cause swap
	*(pixel_ctrl_ptr)=1;
	
	status=*(pixel_ctrl_ptr+3);
	//poll, see if swap is done
	while((status & 0x1)==1){
		status=*(pixel_ctrl_ptr+3);
	}
	
}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

void clear_screen(){
	for(int i=0; i<320;i++){//x
		for(int j=0;j<240;j++){//y
			plot_pixel(i,j,getColor(0,0,0));
		}
	}
}

void draw_line(int x0, int y0, int x1, int y1, short int line_color){
	bool is_steep= abs(y1-y0)>=abs(x1-x0);

	int deltax=x1-x0;
	int deltay=y1-y0;
	
	double slope1=(double)deltay/(double)deltax;
	float slope=slope1;
	//printf("Float value is %f \n", slope);
	
	//draw line
	if(is_steep==false){
		//printf("is not steep");
		if(x0>x1){
			int temp=x1;
			x1=x0;
			x0=temp;
			//neg=neg*(-1);
			temp=y1;
			y1=y0;
			y0=temp;
	    }
		for(int x=x0; x<=x1;x++){
			int y=(double)y0+(double)slope*(double)(x-x0);
			plot_pixel(x, y, line_color);
		}
	}else{
		//printf("is steep");
		if(y0>y1){
			int temp=y1;
			y1=y0;
			y0=temp;
			//neg=neg*(-1);
			temp=x1;
			x1=x0;
			x0=temp;
	    }
		for(int y=y0; y<=y1;y++){
			int x=(double)x0+(double)(y-y0)/slope;
			plot_pixel(x, y, line_color);
	}
		
		
	}
	
	
	
	
}




//r:0-31; g:0-63; b:0-31
int getColor(int r, int g, int b){
	return ((r<<11)+(g<<5)+b);
}
	

	
	
